var title_f41_16_42252="GnRH agonists for GDPP";
var content_f41_16_42252=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F72979&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F72979&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Long-acting gonadotropin-releasing hormone (GnRH) agonists for treatment of gonadotropin-dependent (central) precocious puberty",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        GnRH agonist",
"       </td>",
"       <td class=\"subtitle1\">",
"        Trade names and availability",
"       </td>",
"       <td class=\"subtitle1\">",
"        Dose, frequency and method of administration",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Histrelin acetate subcutaneous implant",
"       </td>",
"       <td>",
"        Supprelin LA (US)",
"       </td>",
"       <td>",
"        Subcutaneous implant. Children &ge;2 years: 50 mg implant surgically inserted every 12 months. Releases approximately 65 mcg per day over 12 months.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"2\">",
"        Leuprolide (leuprorelin acetate)",
"       </td>",
"       <td>",
"        <p>",
"         Lupron Depot-Ped (one month) (US)",
"        </p>",
"        <p>",
"         Lupron Depot CPP (CAN)",
"        </p>",
"        <p>",
"         Eilgard, Lucrin (EU, AU, SA, elsewhere)",
"        </p>",
"       </td>",
"       <td>",
"        Intramuscular depot injection, given every 28 days. Initial dose by body weight:",
"        <br/>",
"        <ul>",
"         <li>",
"          Patients weighing &le;25 kg: 7.5 mg",
"         </li>",
"         <li>",
"          Patients weighing 25-37.5 kg: 11.25 mg",
"         </li>",
"         <li>",
"          Patients weighing &gt;37.5 kg: 15 mg",
"         </li>",
"        </ul>",
"        Titrate dose upward by 3.75 mg every 4 weeks (increase of approximately 10 mcg/kg/day) as needed to achieve clinical response. Starting doses in Europe are typically lower (eg, 3.75 mg/dose).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Lupron Depot-Ped (3 month)",
"       </td>",
"       <td>",
"        Intramuscular depot injection, given every 12 weeks:",
"        <br/>",
"        <ul>",
"         <li>",
"          11.25 or 30 mg",
"         </li>",
"        </ul>",
"        Criteria for selection of the 11.25 mg versus 30 mg dosage have not been established.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Goserelin",
"       </td>",
"       <td>",
"        Zoladex (US, CAN, UK, EU, SA, elsewhere)",
"       </td>",
"       <td>",
"        Subcutaneous implant injected in to the anterior abdominal wall:",
"        <br/>",
"        <ul>",
"         <li>",
"          The 3.6 mg preparation is given once every 28 days",
"         </li>",
"         <li>",
"          The 10.8 mg preparation is given once every 12 weeks",
"         </li>",
"        </ul>",
"        More frequent injections may be needed in some individuals.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Triptorelin",
"       </td>",
"       <td>",
"        Gonapeptyl (UK, EU, SA, elsewhere)",
"       </td>",
"       <td>",
"        Intramuscular depot injection. Initial dose by body weight:",
"        <br/>",
"        <ul>",
"         <li>",
"          Patients weighing &lt;20 kg: 1.875 mg",
"         </li>",
"         <li>",
"          Patients weighing 20-30 kg: 2.5 mg",
"         </li>",
"         <li>",
"          Patients weighing &gt;30 kg: 3.75 mg",
"         </li>",
"        </ul>",
"        Initial three doses given at 14-day intervals with further doses every four weeks. More frequent injections may be needed in some individuals. An 11.25 mg intramuscular depot injection given every 12 weeks is available in some countries.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Approval of these GnRH agonists for use in gonadotropin-dependent precocious puberty (GDPP), dosing, and schedules of administration vary between products in different countries. Consult local product information. Short-acting GnRH preparations requiring daily subcutaneous injections or nasal spray are not recommended due to compliance difficulty; use of these products usually is limited to patients with sterile abscesses from depot injections. Note that the doses used to treat GDPP in children are substantially higher than those used in adults for other indications, such as prostate cancer and endometriosis.",
"    <div class=\"footnotes\">",
"     US: United States; CAN: Canada; EU: European Union; AU: Australia; SA: South America; UK: United Kingdom.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
